    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - 74 * - ( + 38 ) * + col0 / + col0 BETWEEN - + CAST ( NULL AS INTEGER ) AND - - col1;
  - name: tab1

outputs:
  - name: q2675.out
    data: |
      51	14	96
      85	5	59
      91	47	68
